import React from 'react'

class ProfileStatus extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {

        return(
            <div>
                <div>
                    <span>{this.props.userInfo.aboutMe}</span>
                </div>
                <div>
                    <input value={'Hello'}/>
                </div>
            </div>
        )
    }


}

export default ProfileStatus
